import React from 'react';
import airmax from '../images/airmax.png';
import $ from 'jquery';
import { Link } from 'react-router-dom';
/* make the jquery scrolling button */

class Homepage extends React.Component {
	render() {
		return (
			<div>
				<div class="jumbotron hometitlejumbo">
				  <h1 class="display-4">The Garnett Shoe Company</h1>
				  <p class="lead">Some of the finest sneakers created in the United States.</p>
				  <hr class="my-4" />
				  <p class="lead">
				    <a class="btn btn-primary btn-lg" href="#" role="button">Products</a>
				    			        <Link className="nav-link" to={'/products'}>Products</Link>

				  </p>
				</div>
			</div>
		)
	}	
}

export default Homepage;
